Could be name of the generated parameter improved? Maybe in a follow-up change?

For example for addModifiyLister for an SWT Text field I get with an innner class using new ML -> code completion:

		Text text = new Text(parent, SWT.SINGLE | SWT.LEAD | SWT.BORDER);
		text.addModifyListener(new ModifyListener() {

			@Override
			public void modifyText(ModifyEvent e) {

			}
		});

With the new lambda I get:

text.addModifyListener(arg0 -> null);

Would be nicer if arg0 would also be e.
